const animals = [
  { name: "cat", sound: "meow", feedingRequirements:{
    food: 2 ,
    water: 3
  } },
  { name: "dog", sound: "woof" }
];

function useAnimals(animal){
return [
animal.name,
function(){
  console.log(animal.sound);
}
]
}

export default animals; // for const
export {useAnimals}; // for function
